<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\UserAcceptedTermnsOfUse\Domain\UserAcceptedTermnsOfUse;
use Civi\Lughauth\Features\Access\User\Domain\UserRef;
use Civi\Lughauth\Features\Access\TenantTermsOfUse\Domain\TenantTermsOfUseRef;
use Civi\Lughauth\Features\Access\UserAcceptedTermnsOfUse\Domain\ValueObject\UserAcceptedTermnsOfUseUserVO;
use Civi\Lughauth\Features\Access\UserAcceptedTermnsOfUse\Domain\ValueObject\UserAcceptedTermnsOfUseConditionsVO;
use Civi\Lughauth\Features\Access\UserAcceptedTermnsOfUse\Domain\ValueObject\UserAcceptedTermnsOfUseAcceptDateVO;
use Civi\Lughauth\Features\Access\UserAcceptedTermnsOfUse\Domain\ValueObject\UserAcceptedTermnsOfUseVersionVO;
use Civi\Lughauth\Features\Access\UserAcceptedTermnsOfUse\Domain\UserAcceptedTermnsOfUseAttributes;
use PHPUnit\Framework\TestCase;

final class UserAcceptedTermnsOfUseAttributesUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new UserAcceptedTermnsOfUseAttributes();
        $userOneValue = $this->getMockBuilder(UserRef::class)->setConstructorArgs(['one'])->getMock();
        $userOtherValue = $this->getMockBuilder(UserRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->user($userOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(UserRef::class)->setConstructorArgs(['one'])->getMock(), $value->getUser());
        $this->assertNotEquals($this->getMockBuilder(UserRef::class)->setConstructorArgs(['other'])->getMock(), $value->getUser());
        $this->assertEquals($this->getMockBuilder(UserRef::class)->setConstructorArgs(['one'])->getMock(), $value->getUserOrDefault(UserAcceptedTermnsOfUseUserVO::from($userOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(UserRef::class)->setConstructorArgs(['other'])->getMock(), $value->getUserOrDefault(UserAcceptedTermnsOfUseUserVO::from($userOtherValue))->value());
        $value->unsetUser();
        $this->assertEquals($this->getMockBuilder(UserRef::class)->setConstructorArgs(['other'])->getMock(), $value->getUserOrDefault(UserAcceptedTermnsOfUseUserVO::from($userOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(UserRef::class)->setConstructorArgs(['one'])->getMock(), $value->getUserOrDefault(UserAcceptedTermnsOfUseUserVO::from($userOtherValue))->value());
        $conditionsOneValue = $this->getMockBuilder(TenantTermsOfUseRef::class)->setConstructorArgs(['one'])->getMock();
        $conditionsOtherValue = $this->getMockBuilder(TenantTermsOfUseRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->conditions($conditionsOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(TenantTermsOfUseRef::class)->setConstructorArgs(['one'])->getMock(), $value->getConditions());
        $this->assertNotEquals($this->getMockBuilder(TenantTermsOfUseRef::class)->setConstructorArgs(['other'])->getMock(), $value->getConditions());
        $this->assertEquals($this->getMockBuilder(TenantTermsOfUseRef::class)->setConstructorArgs(['one'])->getMock(), $value->getConditionsOrDefault(UserAcceptedTermnsOfUseConditionsVO::from($conditionsOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(TenantTermsOfUseRef::class)->setConstructorArgs(['other'])->getMock(), $value->getConditionsOrDefault(UserAcceptedTermnsOfUseConditionsVO::from($conditionsOtherValue))->value());
        $value->unsetConditions();
        $this->assertEquals($this->getMockBuilder(TenantTermsOfUseRef::class)->setConstructorArgs(['other'])->getMock(), $value->getConditionsOrDefault(UserAcceptedTermnsOfUseConditionsVO::from($conditionsOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(TenantTermsOfUseRef::class)->setConstructorArgs(['one'])->getMock(), $value->getConditionsOrDefault(UserAcceptedTermnsOfUseConditionsVO::from($conditionsOtherValue))->value());
        $acceptDateOneValue = (new \DateTimeImmutable('1980-08-20T14:32:45.123Z'));
        $acceptDateOtherValue = (new \DateTimeImmutable('1981-09-06T14:32:45.123Z'));
        $copy = $value->acceptDate($acceptDateOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getAcceptDate());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getAcceptDate());
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getAcceptDateOrDefault(UserAcceptedTermnsOfUseAcceptDateVO::from($acceptDateOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getAcceptDateOrDefault(UserAcceptedTermnsOfUseAcceptDateVO::from($acceptDateOtherValue))->value());
        $value->unsetAcceptDate();
        $this->assertEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getAcceptDateOrDefault(UserAcceptedTermnsOfUseAcceptDateVO::from($acceptDateOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getAcceptDateOrDefault(UserAcceptedTermnsOfUseAcceptDateVO::from($acceptDateOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(UserAcceptedTermnsOfUseVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(UserAcceptedTermnsOfUseVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(UserAcceptedTermnsOfUseVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(UserAcceptedTermnsOfUseVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
